    "hook": {
      "on-activate": "    export PGPORT=\"${PGPORT:-9002}\"\n\n    export PGUSER=mina_indexer\n    export PGPASS=mina_indexer\n    export PGDATABASE=mina_indexer\n    export SESSION_SECRET=\"$USER-session-secret\"\n\n    # Postgres environment variables\n    export PGDATA=$PWD/postgres_data\n    export PGHOST=$PWD/postgres\n    export LOG_PATH=$PGHOST/LOG\n    export DATABASE_URL=\"postgresql:///$PGDATABASE?host=$PGHOST&port=$PGPORT\"\n    mkdir -p $PGHOST\n    if [ ! -d $PGDATA ]; then\n      echo 'Initializing postgresql database...'\n      initdb $PGDATA --username $PGUSER -A md5 --pwfile=<(echo $PGPASS) --auth=trust\n      echo \"listen_addresses='*'\" >> $PGDATA/postgresql.conf\n      echo \"unix_socket_directories='$PGHOST'\" >> $PGDATA/postgresql.conf\n      echo \"unix_socket_permissions=0700\" >> $PGDATA/postgresql.conf\n    fi\n"
    },
    "profile": {},
    "options": {
      "systems": [
        "aarch64-darwin",
        "x86_64-darwin",
        "aarch64-linux",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    },
    "services": {
      "database": {
        "command": "postgres start",
        "vars": {
          "PGDATABASE": "mina_indexer",
          "PGPASSWORD": "mina_indexer",
          "PGPORT": "9002",
          "PGUSER": "mina_indexer"
        },
        "is-daemon": null,
        "shutdown": null,
        "systems": null
      }
    }
